import './Registro.css';

class Registro extends Component{
    render(){
        return(
            <>
                <form className="formulario" style={styles.formulario}>
                    <div>
                        <label>Nombre</label>
                        <input type="text"></input>
                    </div>
                </form>
            </>

        )
    }
}

export default Registro;
